import React, { useEffect, useState } from 'react'
import Loading from '../shared/Loading'

export const App = () => {
  const [Router, setRouter] = useState(null)

  useEffect(() => {
    import('./Router').then(({Router}) => {setRouter(Router)})
  }, [])

  return <Loading />
}
